import React, {Component} from "react";
// import "./Detail.css";



const Detail = (props) => {

  const details = this.props.portfolioItem.imagesMain;
  {details.map(detail => <Detail key = {detail.toString()} detailImg = {detail}  />)}

return (
    <div> 
    <img src={props.detailImg.url}/>
    </div>
  )
}

export default Detail;
